B.awa=A.a(s(["El hundimiento en pavimentos flexibles suele ser ocasionado por una combinaci\xf3n de factores que afectan la estabilidad estructural del pavimento. Las causas m\xe1s comunes incluyen la saturaci\xf3n de agua en la base subyacente, lo que genera una p\xe9rdida de soporte y produce un asentamiento diferencial del pavimento. Tambi\xe9n puede deberse a una compactaci\xf3n insuficiente del terreno durante la construcci\xf3n, lo que impide que la subrasante proporcione el soporte adecuado. Otro factor importante es el tr\xe1nsito vehicular pesado o concentrado, que ejerce presi\xf3n adicional sobre \xe1reas d\xe9biles del pavimento. Adem\xe1s, la acumulaci\xf3n de agua de lluvia o filtraciones por fallas en el drenaje contribuye a la erosi\xf3n de la base, acelerando el deterioro. El envejecimiento del material asf\xe1ltico tambi\xe9n puede facilitar la aparici\xf3n de hundimientos, especialmente en \xe1reas donde la capa de rodadura se ha vuelto menos resistente con el tiempo."]),t.s)
