B.aGU=A.a(s(["La p\xe9rdida de agregado vial en pavimentos flexibles se presenta cuando las part\xedculas de la mezcla asf\xe1ltica o de la capa de rodadura se desgastan o se desprenden debido a una combinaci\xf3n de factores. La principal causa es la acci\xf3n del tr\xe1fico vehicular constante, que somete la superficie a cargas repetidas que provocan el deslizamiento y desgaste de los agregados. Adem\xe1s, la exposici\xf3n continua a condiciones clim\xe1ticas adversas, como lluvia, calor excesivo o heladas, puede debilitar el material, haciendo que los agregados se desintegren. La falta de una correcta adherencia entre los agregados y el asfalto tambi\xe9n contribuye a esta p\xe9rdida. La insuficiencia en la compactaci\xf3n o el uso de materiales de baja calidad en la mezcla asf\xe1ltica durante la construcci\xf3n inicial puede acelerar este fen\xf3meno. Adem\xe1s, las deficiencias en el drenaje, que permiten la acumulaci\xf3n de agua en la superficie, contribuyen a la erosi\xf3n de los agregados."]),t.s)
